	add("negarchy", "{\"term\":\"negarchy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Coined by w:Daniel Deudney|Daniel Deudney in his paper “Binding Powers, Bound States: The Logic and Geopolitics of Negarchy”, presented to the w:International Studies Association|International Studies Association in w:Washington, D.C.|Washington, D.C., 28th of March–2nd of April in 1994; formed as {{confix|nega|archy|gloss1\u003dnegative|gloss2\u003drule|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of status quo maintained by the interrelations of power structure and authority\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, \u0027Transnational Law \u0026amp; Contemporary Problems\u0027, volume 4, [http://books.google.co.uk/books?id\u003d6tJKAQAAIAAJ\u0026amp;q\u003d%22negarchy%22\u0026amp;dq\u003d%22negarchy%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dJgljT_eTD87A8QOy2NWRCQ\u0026amp;ved\u003d0CDYQ6AEwAA page 397\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Daniel Deudney, Binding Powers, Bound States: The Logic and Geopolitics of \u0027\u0027Negarchy\u0027\u0027 (paper presented at the International Studies Association, Washington, D.C., Mar. 28–Apr. 2, 1994) (on file with author\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, w:Daniel Daniel Deudney, “Binding sovereigns: authorities, structures, and geopolitics in Philadelphian systems” in \u0027State Sovereignty as Social Construct\u0027 ([http://www.cambridge.org/gb/knowledge/isbn/item1153369/?site_locale\u003den_GB Cambridge University Press], ISBN 9780521565998), eds. w:Thomas J. Thomas J. Biersteker and w:Cynthia Cynthia Weber, [http://books.google.co.uk/books?id\u003d2szX9h9n4kYC\u0026amp;pg\u003dPA205\u0026amp;dq\u003d%22negarchy%22+%22negarchies%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dHQxjT9uTH4Xi8APVu7WACA\u0026amp;ved\u003d0CDYQ6AEwA\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22negarchy%22%20%22negarchies%22\u0026amp;f\u003dfalse page 205\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Because the overall system architecture negates, it is appropriate to call the structural principle of this order negarchical and the overall order a \u0027\u0027negarchy\u0027\u0027. The tasks that define security \u0027\u0027negarchies\u0027\u0027 are not arbitrary, and are intimately connected to the logics of both hierarchy and anarchy. \u0027\u0027\u0027Negarchy\u0027\u0027 is the arrangement of institutions needed to prevent simultaneously the emergence of hierarchy and anarchy.\u0027 In a workable \u0027\u0027negarchy\u0027\u0027, the particular configurations of negatives vary with the relative strengths of multiple threats, but the antithesis to hierarchy and anarchy remains constant. Understood in this way, \u0027\u0027negarchy\u0027\u0027 is a third – and liberal – structural principle of political order, along with hierarchy and anarchy\", \"priority\":6}]}, \"synonyms\":{}}");

